import styles from './Search.module.scss'
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';
import Proper from '../../Proper';

function SearchRender(prop,href, tung) {
  let Comp = 'div'
  const _props = {
    tung
  }

  let listResultRender = (list, value) => {
    if (list.length > 0) {
      return (
        <>
          {list.map((result, index) => {
            return (
              <Proper key={index} searchValue={result.name} icon={faMagnifyingGlass} avatar={result.avatar} />
            );
          })}
          <p className={styles['show-result']}>View all results for "{value}"</p>
        </>
      );
    }
  }
  // console.log(searchListStyle)
  return (
    <Comp className={styles['search-list']} {..._props}>
      {listResultRender(prop.list, prop.searchValue)}
    </Comp>

  );
}

export default SearchRender;
